CREATE TABLE "public"."relation" (
  "relat_guid" varchar(36) COLLATE "pg_catalog"."default",
  "group_guid" varchar(36) COLLATE "pg_catalog"."default",
  "card_guid" varchar(36) COLLATE "pg_catalog"."default" DEFAULT uuid_generate_v4()
)
;

ALTER TABLE "public"."relation" 
  OWNER TO "game";

COMMENT ON COLUMN "public"."relation"."relat_guid" IS '关联唯一标识';

COMMENT ON COLUMN "public"."relation"."group_guid" IS '卡组唯一标识';

COMMENT ON COLUMN "public"."relation"."card_guid" IS '卡牌唯一标识';


